import './App.css';

// COMPONENTS
import Navbar from './Components/NavBar/Navbar';
import CardComponent from './Components/Cards/Cards';

class App extends React.Component {
  render() {
    return (
      <>
      <div className="main-container">
        <Navbar 
          item1={"Tienda"}
          item2={"Talleres"}
          item3={"Nosotros"}
          subitem1={"Artística"}
          subitem2={""}
        />
      </div>

      <div className="card-container">
        <CardComponent
          img={"https://images-eu.ssl-images-amazon.com/images/I/81zDiLDflJL.jpg"}
          title={"Aro para bordado"}
          description={"Tamaños varios. Material: madera"}
        />
        <CardComponent
          img={"https://d2r9epyceweg5n.cloudfront.net/stores/251/969/products/dsc_08481-b5dea49a617b6ef21814716934375253-1024-1024.jpg"}
          title={"Anilinas"}
          description={"Colores varios"}
        />
        <CardComponent
          img={"https://d2r9epyceweg5n.cloudfront.net/stores/251/969/products/dsc_00701-c32830dbfeafdd941815018584417676-1024-1024.jpg"}
          title={"Pintura de tela"}
          description={"Colores varios"}
        />
      </div>
    </>
    );
  };
};

export default App;
